import React from 'react';
import {Switch, Route} from 'react-router-dom';
import ResetPassword from './components/resetPassword/resetPassword';
import './App.css';

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact to='/resetPassword/:userId/:token' component={ResetPassword} />
      </Switch>    
    </div>
  );
}

export default App;
